import { Component } from 'react';

import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();

    this.state = {
      nfts: [
        {
          name: 'Jack',
          id: '13j0r23hjt290i-if0-kqw'
        },
        {
          name: 'Frank',
          id: '2480yt32fjngirwegjq'
        },
        {
          name: 'Andrew',
          id: 'bh0ireb039j-eq-133-941'
        },
      ],
    };
  }

  render() {
    return (
      <div className='App'>
        {this.state.nfts.map((nft) => {
          return <h1 key={nft.name}>{nft.name}</h1>;
        })}
      </div>
    );
  }
}

export default App;
